- input: "TEXT\x1CC00510065\x1C.TEXT\x1C\x1CF3A\x1CIn response to the RFAI dated March
    20, 2013, this committee responds as follows:  Q1 - the contribution in question
    was reported on Line 11a, but should have been reported on Line 11c as it is from
    a PAC, and a corrective amendment has been made to this report and the corresponding
    48-hr notice filed on 10/28/2012.  Q2 - Refund checks have been issued to James
    O'Shaughnessy for $1000 on 01/29/2013 (reported in Q1 2013 report), as well as
    merging multiple variants of this donor's name to properly aggregate transactions
    that include a $1000 chargeback/credit card refund, and to Lynn Risica for $500
    on 4/19/2013 (to be reported on Q2 2013 report).  Q3 - all contributions received
    subsequent to the general election were refunded on 01/29/2013 (reported in Q1
    2013 report).  Q4 - the excessive portion of this anonymous contribution was disgorged
    to the American Red Cross on 01/29/2013 (reported in Q1 2013 report).  Q5 - These
    are local political committees whose contributions are permissible, and whose
    funds are from permissible sources, pursuant to 2 U.S.C. 441a(a)(5) and 11 CFR
    110.3(b) (see AO 2005-02 at 7 and AO 1994-04 at 4).  $1000 was refunded to Dover
    Republican Town Committee for that portion of their contribution that was excessive
    on 04/19/2013 (to be reported on Q2 2013 report).  No change in balance.\n"
